script: |
  super -f text -I q11200.spq | sort > q11200.out

inputs:
  - name: q11200.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) NOT BETWEEN + - col2 AND - 34 * + - col1 - + - col0 + CAST ( col0 AS REAL );
  - name: tab1

outputs:
  - name: q11200.out
    data: |
